((
          clamp(sum(increase(calls_total_total)) by (service_name) <= 12000,1,1)
        ) or on() vector(0)) and count(sum(increase(calls_total_total)) by (service_name)[300])  by (service_name) > 0

((
          clamp(sum(increase(calls_total_total{status_code!="STATUS_CODE_ERROR"})) by(service_name) <= 2000,1,1)
        ) or on() vector(0)) and count(sum(increase(calls_total_total{status_code!="STATUS_CODE_ERROR"})) by(service_name)[60])  by (service_name) > 0

((
          clamp(histogram_quantile(0.95, sum(rate(duration_ms_cx_bucket)) by (le)) <= 101,1,1)
        ) or on() vector(0)) and count(histogram_quantile(0.95, sum(rate(duration_ms_cx_bucket)) by (le))[300])  by () > 0

((
          clamp(histogram_quantile(0.95, sum(rate(duration_ms_cx_bucket))by(le)) >= 0,1,1)
        ) or on() vector(0)) and count(histogram_quantile(0.95, sum(rate(duration_ms_cx_bucket))by(le))[60])  by () > 0

((
          clamp(histogram_quantile(0.95, sum(rate(duration_ms_cx_bucket)) by (le)) >= 110,1,1)
        ) or on() vector(0)) and count(histogram_quantile(0.95, sum(rate(duration_ms_cx_bucket)) by (le))[60])  by () > 0

((
          clamp(sum(calls_total_total) by(service_name, status_code) >= 428000000,1,1)
        ) or on() vector(0)) and count(sum(calls_total_total) by(service_name, status_code)[60])  by (service_name, status_code) > 0

((
          clamp(histogram_quantile(0.9, sum(increase(duration_ms_cx_bucket)) by(service, le)) <= 100,1,1)
        ) or on() vector(0)) and count(histogram_quantile(0.9, sum(increase(duration_ms_cx_bucket)) by(service, le))[60])  by (service) > 0

((
          clamp(avg(product_latency_by_country) by (country) < 500 > 65,1,1)
        ) or on() vector(0)) and count(avg(product_latency_by_country) by (country) < 500[60])  by (country) > 0

((
          clamp(sum(calls_total_total) by(service_name, status_code) >= 1000,1,1)
        ) or on() vector(0)) and count(sum(calls_total_total) by(service_name, status_code)[60])  by (service_name, status_code) > 0
